The nuke_classifieds_ads table is not compatible with MySQL5, as 'condition' is a reserved word: http://dev.mysql.com/doc/refman/5.0/en/reserved-words.html
I'm unable to create this table from a mysqldump. Because our goal is to upgrade our master/slave DB servers to MySQL 5, we'll move the EPIC database to a 4.x database server so we can do our upgrade.
CREATE TABLE nuke_classifieds_ads ( ad_id int(5) unsigned NOT NULL auto_increment, cat_id int(5) unsigned NOT NULL default '0', user_id int(11) unsigned NOT NULL default '0', subject text NOT NULL, descript text NOT NULL, price decimal(10,2) NOT NULL default '0.00', type tinyint(1) NOT NULL default '0', condition varchar(50) NOT NULL default '', views int(11) NOT NULL default '0', add_date int(11) NOT NULL default '0', exp_date int(11) NOT NULL default '0', relaunch_date int(11) NOT NULL default '0', country_id smallint(5) NOT NULL default '0', state_id smallint(5) NOT NULL default '0', valid tinyint(2) NOT NULL default '0', mother_id int(5) NOT NULL default '0', PRIMARY KEY (ad_id) ) TYPE=MyISAM;

