import java.awt.Component;
import java.awt.event.*;
import javax.swing.JTextField;

public class TextFieldEditorDefinition {
	protected int fieldLength = 10;

  public JTextField getField() {
  	return new JTextField(fieldLength);   
  }

  public Component getCellEditorComponent(int column, 
                                          final String col1, 
                                          final String col2) {
 	  JTextField field = getField();
    field.setText(((column == 1)?	col1 : col2));
    if (column == 0) {
	    field.addKeyListener(new KeyAdapter() {
		  	public void KeyReleased(KeyEvent e) {
   		  	fieldLength = col1.length();
	      }
		  });
   	} else {
      // TO
	   	field.addKeyListener(new KeyAdapter() {
   			public void KeyReleased(KeyEvent e) {
          fieldLength = col2.length();
		    }
      });
    }
  	return field;
  }
}

