This was reported as a globalization failure by IBM QE.

The basic problem can be reproduced in any eclipse text editor as follows:

1. On an English Windows PC machine, ensure that the East Asian languages are NOT installed.  Go to Control Panel - Regional and Language Options - Languages tab.
2. If "Install files for East Asian Languages" is checked, uncheck it and reboot.
3. In eclipse, create a file and open it in a regular text editor, or any other text based editor.
4. Copy and paste any of the following strings into the editor, and note that nothing will appear, although the asterisk will appear indicating the file needs saving.

Language:	        Test string:

Chinese - Simplified	&#36879;&#38706;&#65292;&#38500;&#20102;&#23436;&#21892;&#20027;&#26495;
Chinese - Traditional	&#36554;&#30340;&#23614;&#32764;&#24517;&#38920;&#32302;&#23567;&#65292;&#20006;&#19988;&#29694;&#22312;&#30340;&#35215;&#21063;
Japanese	        &#65324;&#12391;&#12289;&#12481;&#12540;&#12512;&#12434;&#65300;&#24180;&#12406;&#12426;&#12398;&#27770;&#21213;&#36914;&#20986;&#12395;&#23566;&#12367;
Korean	                &#45936;&#51060;&#53552;&#48288;&#51060;&#49828;&#47484; &#49324;&#50857;&#54616;&#50668; 

Note: the text encoding in the project container must be set to UTF-8 to successfully save the file.

The expected behavior is that fallback characters (typically shown as squares or vertical bars) be shown as placeholders when the text is pasted into the editor, as opposed to nothing at all which is confusing at best espeicially when the file is marked as changed.

